import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

const Link = props => {
    var text;
    if(props.text) {
        text = props.text;
    } else {
        text = props.url;
    }
    return (

        <div bg="warning" key="1" text="black" style={{ width: '18rem' }}>
            <div>
                <div href={props.url}>{text}</div>
            </div>
        </div>)
}

export default Link;
